    {
      "lineNumber": 192592,
      "originalJapaneseLine": "「ひゃー、今日も寒いねー！",
      "translatedEnglishLine": "\"Whee, it's cold again today!\""
    },
    {
      "lineNumber": 192593,
      "originalJapaneseLine": "　ほらほら、息が白ーい！」",
      "translatedEnglishLine": "Look, look, my breath is all white!\""
    },
    {
      "lineNumber": 192594,
      "originalJapaneseLine": "何故かレリコフは嬉しそうに",
      "translatedEnglishLine": "For some reason, Relicof looked happy"
    },
    {
      "lineNumber": 192595,
      "originalJapaneseLine": "真っ白に染まる息を見せつけてきた。",
      "translatedEnglishLine": "and showed off his pure white breath."
    },
    {
      "lineNumber": 192596,
      "originalJapaneseLine": "「へっへー」",
      "translatedEnglishLine": "\"Heh heh—\""
    },
    {
      "lineNumber": 192597,
      "originalJapaneseLine": "レリコフが膝の上にぴょーんと乗ってきた。",
      "translatedEnglishLine": "Relicof suddenly jumped up onto my lap."
    },
    {
      "lineNumber": 192598,
      "originalJapaneseLine": "「こうしてるとあったかいねー」",
      "translatedEnglishLine": "\"It's warm like this, isn't it?\""
    },
    {
      "lineNumber": 192599,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\".........\""
    },
    {
      "lineNumber": 192600,
      "originalJapaneseLine": "あなたはグリグリとレリコフの頭を撫で繰り回した。",
      "translatedEnglishLine": "You vigorously stroked Relicof's head."
    },
    {
      "lineNumber": 192601,
      "originalJapaneseLine": "「にぎゃー、やーめーてー」",
      "translatedEnglishLine": "\"Nyaaa, sto-o-op it!\""
    },
    {
      "lineNumber": 192602,
      "originalJapaneseLine": "レリコフは嬉しそうだった。",
      "translatedEnglishLine": "Relicof seemed happy."
    },
    {
      "lineNumber": 192603,
      "originalJapaneseLine": "「＜エール＞ちゃーん、ちょっとこっち手伝って――",
      "translatedEnglishLine": "\"<Yell>-chan, come help me here a bit—"
    },
    {
      "lineNumber": 192604,
      "originalJapaneseLine": "　くれなくてもいいや、ふふ、そのまま、そのまま」",
      "translatedEnglishLine": "Never mind, you don't have to, hehe, just like that, just like that.\""
    },
    {
      "lineNumber": 192605,
      "originalJapaneseLine": "「おや……」",
      "translatedEnglishLine": "\"Oh...?\""
    },
    {
      "lineNumber": 192606,
      "originalJapaneseLine": "「そうしていればレリコフも可愛いんだけどね……」",
      "translatedEnglishLine": "\"He’s cute when he’s like that, you know...\""
    },
    {
      "lineNumber": 192607,
      "originalJapaneseLine": "「あ、レリコフ寝ちゃったの？",
      "translatedEnglishLine": "\"Ah, did Relicof fall asleep?\""
    },
    {
      "lineNumber": 192608,
      "originalJapaneseLine": "　相変わらず動物みたいな子だね、この子は」",
      "translatedEnglishLine": "He’s still like an animal, this kid.\""
    },
    {
      "lineNumber": 192609,
      "originalJapaneseLine": "「すやすや……ぐうぐう……」",
      "translatedEnglishLine": "\"Snooze, snore...\""
    },
    {
      "lineNumber": 192610,
      "originalJapaneseLine": "レリコフはあなたの膝の上で寝てしまった。",
      "translatedEnglishLine": "Relicof had fallen asleep on your lap."
    },
    {
      "lineNumber": 192611,
      "originalJapaneseLine": "「ねーねー、＜エール＞」",
      "translatedEnglishLine": "\"Hey hey, <Yell>\""
    },
    {
      "lineNumber": 192612,
      "originalJapaneseLine": "「＜エール＞はキスしたことってある？」",
      "translatedEnglishLine": "\"Have you ever kissed someone, <Yell>?\""
    },
    {
      "lineNumber": 192613,
      "originalJapaneseLine": "あなたは頭にスシヌを思い浮かべながら、",
      "translatedEnglishLine": "As you pictured Sushinu in your mind,"
    },
    {
      "lineNumber": 192614,
      "originalJapaneseLine": "あると答えた。",
      "translatedEnglishLine": "you answered that you had."
    },
    {
      "lineNumber": 192615,
      "originalJapaneseLine": "「えーっ、あるんだ！",
      "translatedEnglishLine": "\"What!? You have!?\""
    },
    {
      "lineNumber": 192616,
      "originalJapaneseLine": "　大人、大人！　すごいね、＜エール＞！」",
      "translatedEnglishLine": "\"So grown-up, so grown-up! Amazing, <Yell>!\""
    },
    {
      "lineNumber": 192617,
      "originalJapaneseLine": "レリコフは大興奮だった。",
      "translatedEnglishLine": "Relicof was super excited."
    },
    {
      "lineNumber": 192618,
      "originalJapaneseLine": "「ええっ――！？」",
      "translatedEnglishLine": "\"Ehh—!?!\""
    },
    {
      "lineNumber": 192619,
      "originalJapaneseLine": "「それ、ボクが……＜エール＞と？」",
      "translatedEnglishLine": "\"Was that me... with you, <Yell>?\""
    },
    {
      "lineNumber": 192620,
      "originalJapaneseLine": "「……そ、そんなこと」",
      "translatedEnglishLine": "\"...N-no way.\""
    },
    {
      "lineNumber": 192621,
      "originalJapaneseLine": "「えっ、やっ！　あっ！　冗談か！",
      "translatedEnglishLine": "\"Eh, no! Ah! Just kidding!\""
    },
    {
      "lineNumber": 192622,
      "originalJapaneseLine": "　アハハハハ！」",
      "translatedEnglishLine": "\"Ahahaha!\""
    },
    {
      "lineNumber": 192623,
      "originalJapaneseLine": "「し、しないよー、＜エール＞のえっち！」",
      "translatedEnglishLine": "\"I-I wouldn't do that, you naughty <Yell>!\""
    },
    {
      "lineNumber": 192624,
      "originalJapaneseLine": "「するのかなー、そうなのかなー」",
      "translatedEnglishLine": "\"I wonder if I would—maybe?\""
    },
    {
      "lineNumber": 192625,
      "originalJapaneseLine": "「でも、するって誰とするんだろう」",
      "translatedEnglishLine": "\"But who would I do it with, I wonder?\""
    },
    {
      "lineNumber": 192626,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\".........\""
    },
    {
      "lineNumber": 192627,
      "originalJapaneseLine": "レリコフがあなたの唇をジッと見つめていた。",
      "translatedEnglishLine": "Relicof stared intently at your lips."
    },
    {
      "lineNumber": 192628,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\".........\""
    },
    {
      "lineNumber": 192629,
      "originalJapaneseLine": "「えっ！？　なな、なんでもないよ！？",
      "translatedEnglishLine": "\"Eh!? N-no, it's nothing!\""
    },
    {
      "lineNumber": 192630,
      "originalJapaneseLine": "　ば、ばいばい、もう寝るね！　お休み！」",
      "translatedEnglishLine": "\"B-bye bye, I'm going to sleep now! Good night!\""
    },
    {
      "lineNumber": 192631,
      "originalJapaneseLine": "ぴゃぴゃーとレリコフはあなたから離れて行った。",
      "translatedEnglishLine": "Relicof hurried away from you."
    },
    {
      "lineNumber": 192632,
      "originalJapaneseLine": "（な、なんだろ……胸が締め付けられて……",
      "translatedEnglishLine": "(W-what is this... my chest feels tight..."
    },
    {
      "lineNumber": 192633,
      "originalJapaneseLine": "　何かが、",
      "translatedEnglishLine": "Something,"
    },
    {
      "lineNumber": 192634,
      "originalJapaneseLine": "みゃーってこみ上げてくる……）",
      "translatedEnglishLine": "is welling up inside me with a meow...)"
    },
    {
      "lineNumber": 192635,
      "originalJapaneseLine": "「あ、う、う……」",
      "translatedEnglishLine": "\"Ah, u, u...\""
    },
    {
      "lineNumber": 192636,
      "originalJapaneseLine": "「わおーーーーーーーーーーん！」",
      "translatedEnglishLine": "\"Waoooooooooh!\""
    },
    {
      "lineNumber": 192637,
      "originalJapaneseLine": "「うるせーぞ、レリコフ！」",
      "translatedEnglishLine": "\"Shut up, Relicof!\""
    },
    {
      "lineNumber": 192638,
      "originalJapaneseLine": "どうすればいいのか分からないレリコフは",
      "translatedEnglishLine": "Not knowing what to do, Relicof"
    },
    {
      "lineNumber": 192639,
      "originalJapaneseLine": "とりあえず夜空に向けて吠えた。",
      "translatedEnglishLine": "howled up at the night sky for now."
    },
    {
      "lineNumber": 192640,
      "originalJapaneseLine": "なんとなく、レリコフと、",
      "translatedEnglishLine": "Somehow, with Relicof,"
    },
    {
      "lineNumber": 192641,
      "originalJapaneseLine": "より仲良くなれた気がした。",
      "translatedEnglishLine": "I felt like we’d become closer."
    },
    {
      "lineNumber": 192642,
      "originalJapaneseLine": "「へへ、オイラもがんばるよー」",
      "translatedEnglishLine": "\"Hehe, I'll do my best too—\""
    },
    {
      "lineNumber": 192643,
      "originalJapaneseLine": "「一番上の兄貴が一番合流遅くて悪かったなあ」",
      "translatedEnglishLine": "\"Sorry for being the oldest brother and arriving the latest.\""
    },
    {
      "lineNumber": 192644,
      "originalJapaneseLine": "「よう、久し振りだな。",
      "translatedEnglishLine": "\"Hey, long time no see.\""
    },
    {
      "lineNumber": 192645,
      "originalJapaneseLine": "　探すのに苦労したぜ」",
      "translatedEnglishLine": "\"Had a hard time finding you.\""
    },
    {
      "lineNumber": 192646,
      "originalJapaneseLine": "「あれっ、お兄ちゃん？」",
      "translatedEnglishLine": "\"Huh, big brother?\""
    },
    {
      "lineNumber": 192647,
      "originalJapaneseLine": "あなた達のキャンプ地に",
      "translatedEnglishLine": "To your campsite,"
    },
    {
      "lineNumber": 192648,
      "originalJapaneseLine": "ダークランスがふらりと遊びに来た。",
      "translatedEnglishLine": "Dark Rance casually came to visit."
    },
    {
      "lineNumber": 192649,
      "originalJapaneseLine": "「ダークランスじゃない。",
      "translatedEnglishLine": "\"Isn't that Dark Rance?"
    },
    {
      "lineNumber": 192650,
      "originalJapaneseLine": "　どうしたの？」",
      "translatedEnglishLine": "What's wrong?\""
    },
    {
      "lineNumber": 192651,
      "originalJapaneseLine": "「どうしたのとはご挨拶だな」",
      "translatedEnglishLine": "\"Asking 'what's wrong' is just a greeting, you know.\""
    }
  ]
}

